aWFRuleDesc.RuleDescription:
For Initial Enrollment
Coverage Effective Date = Max{Coverage Eligibility End Date, GBP Effective Date, Member Division Effective Date, Contract Signature Date}
Coverage Eligibility End Date = Member Hire Date + Waiting Period on Effective Date

For Ongoing Enrollment
Coverage Effective Date = Max{Coverage Eligibility End Date, GBP Effective Date, Member Division Effective Date, Contract Signature Date}
Coverage Eligibility End Date = Member Hire Date + Waiting Period after Effective Date
